import React from "react";
import Card from "./Card";
import "./errorModal.css"; // Import the CSS file

const Errormodal = (props) => {
  return (
    <Card className="card">
      <header>
        <h2>{props.title}</h2>
      </header>
      <div>
        <p>{props.message}</p>
      </div>
      <footer>
        <button>Okay</button>
      </footer>
    </Card>
  );
};

export default Errormodal;
